import en from "./en.json";
import fr from "./fr.json";
import arm from "./arm.json";

const info = [
	{
		language: "fr",
		label: "Français",
		path: "./languages/fr.json",
		translationForI18Next: fr,
	},
	{
		language: "en",
		label: "English",
		path: "./languages/en.json",
		translationForI18Next: en,
	},
	{
		language: "arm",
		label: "հայերեն",
		path: "./languages/arm.json",
		translationForI18Next: arm,
	},
];

export default info;
